import ReactPlayer from "react-player";

export class Home extends Component {
    render() {
        return (
            <div>
            <header className="App-header">
                <ReactPlayer url="https://www.youtube.com/watch?v=zTitoHKsyJg" controls={true} style={{}} />
            </header>
            </div>
        )
    }
}

export default Home
